package com.svlada.entity;import javax.persistence.*;import java.io.Serializable;@Entity@Table(name="ORDER_SHIP")public class OrderShip implements Serializable {	private static final long serialVersionUID = 1L;	@Id	@Column(name="ID")	@GeneratedValue(strategy = GenerationType.AUTO)	private Long id;	private String orderid;	private String shipname;	private String shipaddress;	private String province;	private String provinceCode;	private String city;	private String cityCode;	private String area;	private String areaCode;	private String phone;	private String tel;	private String zip;	private String sex;	private String remark;	public OrderShip() {		super();	}	public OrderShip(String orderid) {		this.orderid = orderid;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getOrderid() {		return orderid;	}	public void setOrderid(String orderid) {		this.orderid = orderid;	}	public String getShipname() {		return shipname;	}	public void setShipname(String shipname) {		this.shipname = shipname;	}	public String getShipaddress() {		return shipaddress;	}	public void setShipaddress(String shipaddress) {		this.shipaddress = shipaddress;	}	public String getProvince() {		return province;	}	public void setProvince(String province) {		this.province = province;	}	public String getCity() {		return city;	}	public void setCity(String city) {		this.city = city;	}	public String getArea() {		return area;	}	public void setArea(String area) {		this.area = area;	}	public String getPhone() {		return phone;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getTel() {		return tel;	}	public void setTel(String tel) {		this.tel = tel;	}	public String getZip() {		return zip;	}	public void setZip(String zip) {		this.zip = zip;	}	public String getSex() {		return sex;	}	public void setSex(String sex) {		this.sex = sex;	}	public String getRemark() {		return remark;	}	public void setRemark(String remark) {		this.remark = remark;	}	public String getProvinceCode() {		return provinceCode;	}	public void setProvinceCode(String provinceCode) {		this.provinceCode = provinceCode;	}	public String getCityCode() {		return cityCode;	}	public void setCityCode(String cityCode) {		this.cityCode = cityCode;	}	public String getAreaCode() {		return areaCode;	}	public void setAreaCode(String areaCode) {		this.areaCode = areaCode;	}	@Override	public String toString() {		return "OrderShip [id=" + id + ", orderid=" + orderid + ", shipname="				+ shipname + ", shipaddress=" + shipaddress + ", province="				+ province + ", provinceCode=" + provinceCode + ", city="				+ city + ", cityCode=" + cityCode + ", area=" + area				+ ", areaCode=" + areaCode + ", phone=" + phone + ", tel="				+ tel + ", zip=" + zip + ", sex=" + sex + ", remark=" + remark				+ "]";	}}